package com.switchcase;

public class AssignmentExamle1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int price = 6;
		switch(price)
		{
		case 2: 
			System.out.println("It is a 2");
		default:
			System.out.println("It is a default");
		case 5:
			System.out.println("It is a 5");
		case 9:
			System.out.println("It is a 9");
				
		}

	}

}
